import React from "react";
import { Img, List, Text } from "components";
import Header from "components/Header";
import ItemCard from "components/ItemCard";
import { itemsData, getItemImage } from "components/ItemCard/itemData";

const AssortmenPage: React.FC = () => {
  return (
    <>
      <Header className="your-header-className" />
      <div className="flex flex-col items-center justify-start max-w-[1910px] mx-auto md:px-5 w-full">
        <div className="flex flex-col md:flex-row gap-10 items-center justify-center mt-8 w-[86%] md:w-full">
          {itemsData.map((item) => (
            <div key={item.id}>
              <ItemCard {...item}>{getItemImage(item.imageSrc)}</ItemCard>
            </div>
          ))}
        </div>
      </div>
    </>
  );
};

export default AssortmenPage;
